import './App.css';

function HeaderTest() {
  var degisken="Test Ediliyor"
  return (
    <div className="App">
      <header className="App-header">
        <p>{degisken}</p>
        <p>HeaderTest burada olacak.</p>
      </header>
    </div>
  );
}

export default HeaderTest;
